IER FARIAS","lengthSeconds":"1169","keywords":["Javier Faras (composer)","Sonata (Composition Type)","Classical Guitar (Musical Instrument)"],"channelId":"UCseMwLSQootmfaQiSdsI8RA","isOwnerViewing":false,"shortDescription":"Sonata by Javier Faras (Chile, 1973), dediacted to Jos Antonio Escobar\n1. Proemio 0:22\n2. Desaira 2:44\n3. Axial 7:15\n4. Asedia 14:17\n\nAbout JOS ANTONIO ESCOBAR - Guitarist\n\n...The mastery, intelligence and sound of Jos Antonio on such diverse pieces undoubtedly position him among the outstanding guitarists of our time. (Le Cahiers de la Guitare, Paris, 2002)\n\nFinally Jos Antonio Escobar gave us Villa-Lobos 12 Etudes, demonstrating that he is one of the finest young players to have emerged from South America in recent years (Robert Matthew-Walker, Musical Opinion, London,  May 2007).\n\nEscobar is an expressive, mature artist who has transcended the nitty-gritty of technique and gets to the essence of the music. (Jeffrey Rossman, Classical Voice of North Carolina, 2008).\n\nGuitar aficionados need to hear Escobars absolutely stunning playing. (Gran Forsling, MusicWeb International, 2008)\n\n\"I cannot and should not miss the opportunity to speak in favor of one of the most remarkable\nmusicians devoting their talent to the guitar. His name is Jos Antonio Escobar...\" (Angelo Gilardino, Suonare Magazine, Italy, 2012)\n\nJos Antonio Escobar (b. 1973), was born in Santiago de Chile, where he graduated with Top Honors after studying at the Conservatory of Music-University of Chile. Immediately after graduating, he continued to perfect his studies at the Hochschule fr Musik in Augsburg, Germany with Franz Halasz. Under the influence of his first master, the lutenist Ernesto Quezada, he became deeply interested in original ancient instruments from the guitar family. This motivated him to round out his studies by attending Early Music courses and master classes with renowned specialists such as Hopkinson Smith, Eduardo Egez, and Juan Carlos Rivera. \nWhile he is greatly interested in ancient music, he has always felt at home when interpreting 20th Century or contemporary music. This has led him to commission, premiere and record works by renowned composers as well as Chilean composers, in particular. He has also devoted some time to studying and interpreting music with popular and folk influences from Latin America. In this regard, he has worked in various projects both as a soloist and as part of Do Sudamericano, along with Javier Contreras, an outstanding Chilean composer and guitarist. \nThroughout a period encompassing almost 10 years, he obtained more than fifteen prizes in the most prestigious International Guitar Competitions today, such as Francisco Trrega (Spain), Alessandria (Italy), Alhambra (Spain), Guitar Foundation of America (USA), Julian Arcas (Spain), Karl Sheit (Austria), among many others. \nAs a soloist and chamber musician he has toured over 30 countries, covering almost all of Europe and the Americas, as well as some North African countries, the Near East, Asia and Oceania. He has also performed as a soloist with distinguished orchestras, namely Orquesta de Extremadura (Spain), Orchestra Filarmonica di Torino (Italy), St. Michel Strings (Finland), Hofer Symphoniker (Germany), and the Orquesta Sinfnica de Chile. He has also debuted in major concert halls such as the Brahms-Saal at the Vienna Musikverein, the Purcell Room at the Southbank Centre in London, the Herbst Theatre in San Francisco, Sala Cecilia Meireles in Rio de Janeiro, Teatro Monumental in Madrid, Teatro Teresa Carreo in Caracas, etc. \nHe has completed several recordings under the NAXOS and RTVE labels, receiving excellent reviews from specialized media. He has also worked on several independent recordings both as an artist and producer. He is currently living in Barcelona, and he is constantly invited to not only perform at recitals but also share his expertise by giving master classes and lectures at major music festivals, courses, seminars and workshops in prestigious universities around Europe and the Americas.  \n\nGuitar: Simon Marty (2001)\n\nVisit Jos Antonio Escobar websites: http://www.joseantonioescobar.cl/\nFacebook page: https://www.facebook.com/joseantonioguitarist\n\nSonata para guitarra del compositor chileno Javier Faras escrita para Jos Antonio Escobar. \nObra ganadora del 1er Premio en el  Concurso Internacional de Composicin Michele Pittaluga, Alessandria, Italia, 2004. \n\n\nJavier Faras: http://www.javierfarias.cl/home.html","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/D5drbnk1u14/hqdefault.jpg?sqp=-oaymwE8CKgBEF5IWvKriqkDLwgBFQAAAAAYASUAAMhCPQCAokN4AfABAfgBzgWAAuADigIMCAAQARhlIE4oRTAP\u0026rs=AOn4CLDxmo75gP-UKQ63TngNKKpFA8FULg","width":168,"height":94},{"url":"https://i.ytimg.com/vi/D5drbnk1u14/hqdefault.jpg?sqp=-oaymwE8CMQBEG5IWvKriqkDLwgBFQAAAAAYASUAAMhCPQCAokN4AfABAfgBzgWAAuADigIMCAAQARhlIE4oRTAP\u0026rs=AOn4CLBmeb063xKJZXEw5XQbLQC4D1MFkw","width":196,"height":110},{"url":"https://i.ytimg.com/vi/D5drbnk1u14/hqdefault.jpg?sqp=-oaymwE9CPYBEIoBSFryq4qpAy8IARUAAAAAGAElAADIQj0AgKJDeAHwAQH4Ac4FgALgA4oCDAgAEAEYZSBOKEUwDw==\u0026rs=AOn4CLA0nHa1JJIn193Zu617feVIWKieuw","width":246,"height":138},{"url":"https://i.ytimg.com/vi/D5drbnk1u14/hqdefault.jpg?sqp=-oaymwE9CNACELwBSFryq4qpAy8IARUAAAAAGAElAADIQj0AgKJDeAHwAQH4Ac4FgALgA4oCDAgAEAEYZSBOKEUwDw==\u0026rs=AOn4CLD0H7YeJSZiYjKyd4JeWuYJ2ltosg","width":336,"height":188}]},"allowRatings":true,"viewCount":"3893","author":"Jos Antonio Escobar","isPrivate":false,"isUnpluggedCorpus":false,"isLiveContent":false},"microformat":{"playerMicroformatRenderer":{"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/D5drbnk1u14/hqdefault.jpg?sqp=-oaymwEmCOADEOgC8quKqQMa8AEB-AHOBYAC4AOKAgwIABABGGUgTihFMA8=\u0026rs=AOn4CLBIsBRGey1-ebU5pb8GGxSAPi4hMw","width":480,"height":360}]},"embed":{"iframeUrl":"https://www.youtube.com/embed/D5drbnk1u14","width":480,"height":360},"title":{"simpleText":"SONATA by JA  record works by renowned composers as well as Chilean composers, in particular. He has also devoted some time to studying and interpreting music with popular and folk influences from Latin America. In this regard, he has worked in various projects both as a soloist and as part of Do Sudamericano, along with Javier Contreras, an outstanding Chilean composer and guitarist. \nThroughout a period encompassing almost 10 years, he obtained more than fifteen prizes in the most prestigious International Guitar Competitions today, such as Francisco Trrega (Spain), Alessandria (Italy), Alhambra (Spain), Guitar Foundation of America (USA), Julian Arcas (Spain), Karl Sheit (Austria), among many others. \nAs a soloist and chamber musician he has toured over 30 countries, covering almost all of Europe and the Americas, as well as some North African countries, the Near East, Asia and Oceania. He has also performed as a soloist with distinguished orchestras, namely Orquesta de Extremadura (Spain), Orchestra Filarmonica di Torino (Italy), St. Michel Strings (Finland), Hofer Symphoniker (Germany), and the Orquesta Sinfnica de Chile. He has also debuted in major concert halls such as the Brahms-Saal at the Vienna Musikverein, the Purcell Room at the Southbank Centre in London, the Herbst Theatre in San Francisco, Sala Cecilia Meireles in Rio de Janeiro, Teatro Monumental in Madrid, Teatro Teresa Carreo in Caracas, etc. \nHe has completed several recordings under the NAXOS and RTVE labels, receiving excellent reviews from specialized media. He has also worked on several independent recordings both as an artist and producer. He is currently living in Barcelona, and he is constantly invited to not only perform at recitals but also share his expertise by giving master classes and lectures at major music festivals, courses, seminars and workshops in prestigious universities around Europe and the Americas.  \n\nGuitar: Simon Marty (2001)\n\nVisit Jos Antonio Escobar websites: http://www.jo XT","size":"SIZE_DEFAULT","isDisabled":false,"text":{"runs":[{"text":"Cancel"}]},"accessibility":{"label":"Cancel"},"trackingParams":"COgBEPBbIhMI_on1_8DnjwMV7QloCB1BPANA"}},"primaryIsCancel":false}},"popupType":"DIALOG"}}]}}]}},"metadataRowContainer":{"metadataRowContainerRenderer":{"collapsedItemCount":0,"trackingParams":"COUBEM2rARgBIhMI_on1_8DnjwMV7QloCB1BPANA"}},"showMoreText":{"simpleText":"...more"},"showLessText":{"simpleText":"Show less"},"trackingParams":"COUBEM2rARgBIhMI_on1_8DnjwMV7QloCB1BPANA","defaultExpanded":false,"descriptionCollapsedLines":3,"showMoreCommand":{"clickTrackingParams":"COUBEM2rARgBIhMI_on1_8DnjwMV7QloCB1BPANAygEEcloSFQ==","commandExecutorCommand":{"commands":[{"clickTrackingParams":"COUBEM2rARgBIhMI_on1_8DnjwMV7QloCB1BPANAygEEcloSFQ==","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_EXPANDED"}},{"clickTrackingParams":"COUBEM2rARgBIhMI_on1_8DnjwMV7QloCB1BPANAygEEcloSFQ==","scrollToEngagementPanelCommand":{"targetId":"engagement-panel-structured-description"}}]}},"showLessCommand":{"clickTrackingParams":"COUBEM2rARgBIhMI_on1_8DnjwMV7QloCB1BPANAygEEcloSFQ==","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}},"attributedDescription":{"content":"Sonata by Javier Faras (Chile, 1973), dediacted to Jos Antonio Escobar\n1. Proemio 0:22\n2. Desaira 2:44\n3. Axial 7:15\n4. Asedia 14:17\n\nAbout JOS ANTONIO ESCOBAR - Guitarist\n\n...The mastery, intelligence and sound of Jos Antonio on such diverse pieces undoubtedly position him among the outstanding guitarists of our time. (Le Cahiers de la Guitare, Paris, 2002)\n\nFinally Jos Antonio Escobar gave us Villa-Lobos 12 Etudes, demonstrating that he is one of the finest young players to have emerged from South America in recent years (Robert Matthew-Walker, Musical Opinion, London,  May 2007).\n\nEscobar is an expressive, mature artist who has transcended the nitty-gritty of technique and gets to the essence of the music. (Jeffrey Rossman, Classical Voice of North Carolina, 2008).\n\nGuitar aficionados need to hear Escobars absolutely stunning playing. (Gran Forsling, MusicWeb International, 2008)\n\n\"I cannot and should not miss the opportunity to speak in favor of one of the most remarkable\nmusicians devoting their talent to the guitar. His name is Jos Antonio Escobar...\" (Angelo Gilardino, Suonare Magazine, Italy, 2012)\n\nJos Antonio Escobar (b. 1973), was born in Santiago de Chile, where he graduated with Top Honors after studying at the Conservatory of Music-University of Chile. Immediately after graduating, he continued to perfect his studies at the Hochschule fr Musik in Augsburg, Germany with Franz Halasz. Under the influence of his first master, the lutenist Ernesto Quezada, he became deeply interested in original ancient instruments from the guitar family. This motivated him to round out his studies by attending Early Music courses and master classes with renowned specialists such as Hopkinson Smith, Eduardo Egez, and Juan Carlos Rivera. \nWhile he is greatly interested in ancient music, he has always felt at home when interpreting 20th Century or contemporary music. This has led him to commission, premiere and record works by renowned composers as well as Chilean composers, in particular. He has also devoted some time to studying and interpreting music with popular and folk influences from Latin America. In this regard, he has worked in various projects both as a soloist and as part of Do Sudamericano, along with Javier Contreras, an outstanding Chilean composer and guitarist. \nThroughout a period encompassing almost 10 years, he obtained more than fifteen prizes in the most prestigious International Guitar Competitions today, such as Francisco Trrega (Spain), Alessandria (Italy), Alhambra (Spain), Guitar Foundation of America (USA), Julian Arcas (Spain), Karl Sheit (Austria), among many others. \nAs a soloist and chamber musician he has toured over 30 countries, covering almost all of Europe and the Americas, as well as some North African countries, the Near East, Asia and Oceania. He has also performed as a soloist with distinguished orchestras, namely Orquesta de Extremadura (Spain), Orchestra Filarmonica di Torino (Italy), St. Michel Strings (Finland), Hofer Symphoniker (Germany), and the Orquesta Sinfnica de Chile. He has also debuted in major concert halls such as the Brahms-Saal at the Vienna Musikverein, the Purcell Room at the Southbank Centre in London, the Herbst Theatre in San Francisco, Sala Cecilia Meireles in Rio de Janeiro, Teatro Monumental in Madrid, Teatro Teresa Carreo in Caracas, etc. \nHe has completed several recordings under the NAXOS and RTVE labels, receiving excellent reviews from specialized media. He has also worked on several independent recordings both as an artist and producer. He is currently living in Barcelona, and he is constantly invited to not only perform at recitals but also share his expertise by giving master classes and lectures at major music festivals, courses, seminars and workshops in prestigious universities around Europe and the Americas.  \n\nGuitar: Simon Marty (2001)\n\nVisit Jos Antonio Escobar websites: http://www.joseantonioescobar.cl/\nFacebook page: /joseantonioguitarist\n\nSonata para guitarra del compositor chileno Javier Faras escrita para Jos Antonio Escobar. \nObra ganadora del 1er Premio en el  Concurso Internacional de Composicin Michele Pittaluga, Alessandria, Italia, 2004. \n\n\nJavier Faras: http://www.javierfarias.cl/home.html","commandRuns":[{"startIndex":84,"length":4,"onTap":{"innertubeCommand":{"clickTrackingParams":"COUBEM2rARgBIhMI_on1_8DnjwMV7QloCB1BPANAygEEcloSFQ==","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=D5drbnk1u14\u0026t=22s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"D5drbnk1u14","continuePlayb frey Rossman, Classical Voice of North Carolina, 2008).\n\nGuitar aficionados need to hear Escobars absolutely stunning playing. (Gran Forsling, MusicWeb International, 2008)\n\n\"I cannot and should not miss the opportunity to speak in favor of one of the most remarkable\nmusicians devoting their talent to the guitar. His name is Jos Antonio Escobar...\" (Angelo Gilardino, Suonare Magazine, Italy, 2012)\n\nJos Antonio Escobar (b. 1973), was born in Santiago de Chile, where he graduated with Top Honors after studying at the Conservatory of Music-University of Chile. Immediately after graduating, he continued to perfect his studies at the Hochschule fr Musik in Augsburg, Germany with Franz Halasz. Under the influence of his first master, the lutenist Ernesto Quezada, he became deeply interested in original ancient instruments from the guitar family. This motivated him to round out his studies by attending Early Music courses and master classes with renowned specialists such as Hopkinson Smith, Eduardo Egez, and Juan Carlos Rivera. \nWhile he is greatly interested in ancient music, he has always felt at home when interpreting 20th Century or contemporary music. This has led him to commission, premiere and record works by renowned composers as well as Chilean composers, in particular. He has also devoted some time to studying and interpreting music with popular and folk influences from Latin America. In this regard, he has worked in various projects both as a soloist and as part of Do Sudamericano, along with Javier Contreras, an outstanding Chilean composer and guitarist. \nThroughout a period encompassing almost 10 years, he obtained more than fifteen prizes in the most prestigious International Guitar Competitions today, such as Francisco Trrega (Spain), Alessandria (Italy), Alhambra (Spain), Guitar Foundation of America (USA), Julian Arcas (Spain), Karl Sheit (Austria), among many others. \nAs a soloist and chamber musician he has toured over 30 countries, covering almost all of Europe and the Americas, as well as some North African countries, the Near East, Asia and Oceania. He has also performed as a soloist with distinguished orchestras, namely Orquesta de Extremadura (Spain), Orchestra Filarmonica di Torino (Italy), St. Michel Strings (Finland), Hofer Symphoniker (Germany), and the Orquesta Sinfnica de Chile. He has also debuted in major concert halls such as the Brahms-Saal at the Vienna Musikverein, the Purcell Room at the Southbank Centre in London, the Herbst Theatre in San Francisco, Sala Cecilia Meireles in Rio de Janeiro, Teatro Monumental in Madrid, Teatro Teresa Carreo in Caracas, etc. \nHe has completed several recordings under the NAXOS and RTVE labels, receiving excellent reviews from specialized media. He has also worked on several independent recordings both as an artist and producer. He is currently living in Barcelona, and he is constantly invited to not only perform at recitals but also share his expertise by giving master classes and lectures at major music festivals, courses, seminars and workshops in prestigious universities around Europe and the Americas.  \n\nGuitar: Simon Marty (2001)\n\nVisit Jos Antonio Escobar websites: http://www.joseantonioescobar.cl/\nFacebook page: /joseantonioguitarist\n\nSonata para guitarra del compositor chileno Javier Faras escrita para Jos Antonio Escobar. \nObra ganadora del 1er Premio en el  Concurso Internacional de Composicin Michele Pittaluga, Alessandria, Italia, 2004. \n\n\nJavier Faras: http://www.javierfarias.cl/home.html","commandRuns":[{"startIndex":84,"length":4,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBUQ040EGAUiEwj-ifX_wOePAxXtCWgIHUE8A0DKAQRyWhIV","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=D5drbnk1u14\u0026t=22s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"D5drbnk1u14","continuePlayback":true,"startTimeSeconds":22,"watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig"
